rship\",\n        \"local_text\": \"Come let us worship\\nand Pow down\\nLet us kneel before the Lord our\\nGod our Maker (2)\\nFor He is our God,\\nand we are the people\\nof His pasture,\\nAnd the sheep of His hand,\\nJust the sheep of His hand\",\n        \"local_category\": \"nothing\",\n        \"local_categorycount\": \"1\",\n        \"index_letter\": \"C\",\n        \"song_chord\": \"C\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"37\",\n                \"title\": \"37. Come let us worship\",\n                \"artist\": \"\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://vidhyarthigeethavali.com/uesi/audio_songs/english/songs/37.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"38\",\n        \"local_title\": \"Come on and Celebrate\",\n        \"local_hint\": \"Come on and Celebrate\",\n        \"local_text\": \"Come on and Celebrate\\nHis gift of love, we will celebrate\\nThe Son of God who loved us\\nAnd gave us life\\nWe\'ll shout Your praise, O king\\nYou give us joy\\nnothing else can bring\\nWe\'ll give to You our offering\\nIn celebration praise\\ncome on and celebrate, celebrate\\nCelebrate and sing\\nCelebrate and sing to the King(2)\",\n        \"local_category\": \"nothing\",\n        \"local_categorycount\": \"1\",\n        \"index_letter\": \"C\",\n        \"song_chord\": \"C\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"38\",\n                \"title\": \"38. Come on and Celebrate\",\n                \"artist\": \"\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://vidhyarthigeethavali.com/uesi/audio_songs/english/songs/38.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"39\",\n        \"local_title\": \"Crown him with many Crowns\",\n        \"local_hint\": \"Crown him with many Crowns\",\n        \"local_text\": \"Crown him with many Crowns\\nThe Lamb upon His throne;\\nHark, how the heavenly anthem drowns\\nAll music but its own!\\nAwake,my soul, and sing\\nOf Him who died for Thee,\\nAnd hail Him as thy matchless King\\nThrough all eternity.\\n\\n2. Crown Him the Lord of life,\\nWho triumphed Oer the grave\\nAnd rose victorious in the strife\\nFor those He came to save:\\nHis glories now we sing,\\nWho died and rose on high,\\nWho died eternal life to bring\\nAnd lives that death may die.\\n\\n3. Crown Him the Lord of love;\\nBehold His hands and side,\\nThose wounds yet visible above\\nIn beauty glorified;\\nNo angel in the sky\\nCan fully bear that sight,\\nBut downward bends His buming eye\\nAt mysteries so bright.\\n\\n4. Crown Him the Lord of peace,\\nWhose power a sceptre sways\\nFrom pole to pole that wars may cease,\\nAnd all be prayer and praise:\\nHis reign shall know no end,\\nAnd round His pierced feet\\nFair flowers of paradise extend\\nTheir fragrance ever sweet.\\n\\n5. Crown Him the Lord of years,\\nThe Potentate of time,\\nCreator of the rolling spheres,\\nIneffably sublime;\\nAll hail, Redeemer, hail\\nFor Thou hast died for me;\\nThy praise shall never, never fail\\nThroughout eternity.\",\n        \"local_category\": \"nothing\",\n        \"local_categorycount\": \"1\",\n        \"index_letter\": \"C\",\n        \"song_chord\": \"C\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"39\",\n                \"title\": \"39. Crown him with many Crowns\",\n                \"artist\": \"\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://vidhyarthigeethavali.com/uesi/audio_songs/english/songs/39.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"40\",\n        \"local_title\": \"Don\'t you know, O Christian\",\n        \"local_hint\": \"Don\'t you know, O Christian\",\n        \"local_text\": \"1. Don\'t you know, O Christian,\\nYou\'ve